import React, { useState } from 'react';
import { Button, Label, FormGroup, Input, CustomInput } from 'reactstrap';

import './CodeToggle.css';


const CodeToggle = () => {

  return (
    <div className="codeToggle-container">

      <Label>Active codes</Label>
      <div className="btn-group">
        <Button size="sm">+</Button>
        <Button size="sm">-</Button>
      </div>

      <div className="code-list-container">
        <FormGroup check>
          <CustomInput type="checkbox" id="exampleCustomCheckbox" label="Check this custom checkbox" />
          <CustomInput type="checkbox" id="exampleCustomCheckbox2" label="Or this one" />
          <CustomInput type="checkbox" id="exampleCustomCheckbox3" label="But not this disabled one" disabled />
          <CustomInput type="checkbox" id="exampleCustomCheckbox4" label="Can't click this label to check!" htmlFor="exampleCustomCheckbox4_X" disabled />
        </FormGroup>
      </div>

    </div>
  );
}

export default CodeToggle;
